import React, {Component} from "react";
class Header extends Component {
    render(){
        return(
            <div className="header">
                <div class="box"><font></font>
                    <div class="container-1"><font></font>
                        <span class="icon"><i class="fa fa-search"></i></span><font></font>
                        <input type="search" id="search" placeholder="Search..." /><font></font>
                    </div><font></font>
</div>
            <img
              className="headerImg"
              src="https://toigingiuvedep.vn/wp-content/uploads/2021/07/canh-thien-nhien-viet-nam-dep.jpg"
              alt=""
            />
          </div>
    
            );
        }
}
export default Header
